classdef testReadingGmsh < testShowingError ...                         & testLoadStoredVariable ...                         & testStoredComputedChecker            properties (Access = protected)        tol = 1e-13;        testName = 'testReadingGmsh.mat'        variablesToStore = {'connec','coord',...                            'isElemInThisSet',...                            'masterSlave','corners'};    end              methods (Access = public, Static)                    function obj = testReadingGmsh()           filePath = fullfile('tests','Source','ReadingFilesTests','ReadingFiles','testReadingGmsh.msh');           reader = GmsReader(filePath);           reader.read();           readData = reader.getDataBase();           obj.computedVar{1} = readData.connec;           obj.computedVar{2} = readData.coord;           obj.computedVar{3} = readData.isElemInThisSet{1};           obj.computedVar{4} = readData.masterSlave;           obj.computedVar{5} = readData.corners;        end            end    end